import React from 'react';
import {Redirect ,Router} from 'react-router-dom';
const PrivetRouter =({component:Component,path ,isAuth, ...rest})=>{
  if (isAuth){
      return<Redirect to='/'/>
  }
  return(
    <Router  path={path} render={(props)=> <Component {...props} {...rest}/>}/>
  )
     
}
export  default  PrivetRouter ;
